CREATE DATABASE `db_bi`;

USE `db_bi`;

CREATE TABLE `cost_rule` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `cost_type` varchar(64) DEFAULT NULL COMMENT '指标类型',
  `field_name` varchar(64) DEFAULT NULL COMMENT '字段名称',
  `expressions` text COMMENT '用于过滤数据的java script',
  `pid` int unsigned NOT NULL DEFAULT 0 COMMENT '父节点Id',
  `pids` varchar(255) NOT NULL DEFAULT '' COMMENT '所有父节点ID，逗号分隔，从根节点到子节点有序',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_costrule_costtype` (`cost_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='费用规则';

